import axios from 'axios';
import NextVideo from '../NextVideo/NextVideo';


const apiVideoUrl = 'https://project-2-api.herokuapp.com/videos?api_key=6916121c-e9ae-42eb-84fe-849b231c9ee3';
const apiSelectedVideoUrl = `https://project-2-api.herokuapp.com/videos/${response.data.id}?api_key=%3C123%3E`;

export default function getVideo() {
    axios ({
        method: 'get',
        url: apiVideoUrl,
    }).then((response) => {
        NextVideo(response.data)
        console.log(response.data);
    })
} 

export function getSelectedVideo() {
    axios ({
        method: 'get',
        url: apiSelectedVideoUrl,
    }).then((response) => {
        console.log(response);
    });
}
